import React, { useState } from "react";
import styled from 'styled-components';
import ModalRegister from "./ModalRegister";

const Cuenta = () => {

    const [estadoModal, cambiarEstadoModal] = useState(false)
    return (
        <div>
            <ContenedorAnclas>
                <Ancla onClick={() => cambiarEstadoModal(!estadoModal)}>Crear cuenta</Ancla>
            </ContenedorAnclas>

            <ModalRegister
                estado={estadoModal}
                cambiarEstado={cambiarEstadoModal}
            >
                <Contenido>
                    <div className="login-box">
                        <p>Registrarse</p>
                        <form>
                            <div className="user-box">
                                <input required type="text"/>
                                <label>Nombre y Apellidos</label>
                            </div>
                            <div className="user-box">
                                <input required type="email"/>
                                <label>Correo Electrónico</label>
                            </div>
                            <div className="user-box">
                                <input required type="password"/>
                                <label>Contraseña</label>
                            </div>
                            <div className="user-box">
                                <input required type="password"/>
                                <label>Confirmacion contraseña</label>
                            </div>
                            <a href="">
                                <span></span>
                                <span></span>
                                <span></span>
                                <span></span>
                                Registrarse
                            </a>
                        </form>
                        <p>¿Ya tienes cuenta? <a className="a2">Iniciar Sesion</a></p>
                    </div>
                </Contenido>
            </ModalRegister>
        </div>
    );
}

export default Cuenta;

const ContenedorAnclas = styled.div`
    font-family: 'Bruno Ace SC', cursive;
    padding: 3px;
`;

const Ancla = styled.div`
    color: black;
    cursor: pointer;
    padding: 3px;
`;

const Contenido = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
	.login-box {
        position: absolute;
        top: 50%;
